import React, { Component, Fragment} from 'react'

import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
import PageviewIcon from '@material-ui/icons/Pageview'
import Button from '@material-ui/core/Button'


class fridgeMagnets extends Component {
  constructor(props)
  {
    super(props)
  }

  render() {

    return (
      <div>
        <Grid container justify="center" alignItems="baseline">
        {(
        this.props.stores==null
          ?""
          :this.props.stores.map((store) => (
            <Paper elevation={3} style={{margin:"5px", padding:"15px"}}>
              <p style={{maxWidth:"100"}}><strong>{store.name}</strong></p>
              <p><small>{store.address}</small></p>
              <Button
                variant="outlined"
                color="secondary"
                size="small"
                startIcon={<PageviewIcon />}
              >
                Ver
              </Button>
            </Paper>
          ))
        )}
        </Grid>
      </div>
    )
  }
}

export default fridgeMagnets;
